import React,{ Component } from "react";
import { Row,Label,Col,Button,Input ,Form, FormGroup} from "reactstrap";
import http from '../common'
import Notification,{ notify } from "react-notify-toast";

class DonationRegistration extends Component{
    constructor(props){
        super(props);
        this.state = {
            id       : '',
            adhar_no       : '',
            component_name       : '',
            quantity    : '',
            nurseid      : '',
            d_date    :  ''
        }
    }
    handleSubmit(e){
        e.preventDefault()
        console.log(this.state)
        const newDonation={
        'id': this.state.id,
        'adhar_no': this.state.adhar_no,
        'component_name': this.state.component_name,
        'quantity': this.state.quantity,
        'nurseid': this.state.nurseid,
        'd_date': this.state.d_date
        }
        http.post('donation',{newDonation})
        .then(response=>{
            console.log(response)
            notify.show('Donation Added.','success',300)
        })
        .catch(error=>{
            console.log(error)
        })
    }
    render(){
        return(
            <div className="row row-content">
                <Notification/>
                <div className="col-12 offset-1">
                    <h3>Donation Registration</h3>
                    <hr/>
                    <div className="col-12 col-md-9">
                        <Form>
                        <Row className="form-group">
                                <Label htmlFor="id" md={2}>Id</Label>
                                <Col md={10}>
                                    <Input type="text"  id="id" name="id"
                                        placeholder="id"
                                        className="form-control"
                                        onChange={
                                            (e) => {
                                                this.setState({id:e.target.value});
                                            }
                                        }
                                    />
                                </Col>
                            </Row>
                            {/* <div style={this.getStyles()}> */}
                                <Row className="form-group">
                                    <Label htmlFor="Adhar_no" md={2}>Adhar_no</Label>
                                    <Col md={10}>
                                        <Input type="text" id="adhar_no" name="Adhar_no"
                                            placeholder="adhar number Name"
                                            className="form-control"
                                            onChange={
                                                (e) => {
                                                    this.setState({ adhar_no : e.target.value })
                                                }
                                            }
                                        />
                                    </Col>
                                </Row>
                                <Row className="form-group">
                                    <Label htmlFor="component_name" md={2}>component_name No.</Label>
                                    <Col md={10}>
                                        <Input type="text" id="component_name" name="component_name"
                                            placeholder="rbc"
                                            className="form-control"
                                            onChange={
                                                (e) => {
                                                    this.setState({ component_name : e.target.value })
                                                }
                                            }
                                        />
                                    </Col>
                                </Row>
                                <Row className="form-group">
                                    <Label htmlFor="d_date" md={2}>d_date</Label>
                                    <Col md={10}>
                                        <Input type="date" rows="3" id="d_date" name="d_date"
                                            placeholder="Donation Date"
                                            className="form-control"
                                            onChange={
                                                (e) => {
                                                    this.setState({ d_date : e.target.value })
                                                }
                                            }
                                        />
                                    </Col>
                                </Row>
                                <Row className="form-group">
                                    <Label htmlFor="quantity" md={2}>quantity</Label>
                                    <Col md={10}>
                                        <Input  id="quantity" name="quantity"
                                            placeholder="Enter units"
                                            className="form-control"
                                            onChange={
                                                (e) => {
                                                    this.setState({ quantity : e.target.value })
                                                }
                                            }
                                        />
                                    </Col>
                                </Row>
                                <Row className="form-group">
                                    <Label htmlFor="nurseid" md={2}>nurseid</Label>
                                    <Col md={10}>
                                        <Input  id="nurseid" name="nurseid"
                                            placeholder="Enter nurseid"
                                            className="form-control"
                                            onChange={
                                                (e) => {
                                                    this.setState({ nurseid : e.target.value })
                                                }
                                            }
                                        />
                                    </Col>
                                </Row>

                            {/* </div> */}
                            <Row className="form-group">
                                <Col md={{ size: 10, offset: 2 }}>
                                    <Button color="primary" onClick={(values) => this.handleSubmit(values)}>
                                        Add Donation
                                    </Button>
                                </Col>
                            </Row>
                        </Form>
                    </div>
                </div>
            </div>
        )
    }
}

export default DonationRegistration;
